import React from 'react'
import logo from '../img/logo.png'
import '../CSS/Header.css'

class Header extends React.Component {
	render() {
		return (
			<header className='Header'>
				<a href='/'>
					<img src={logo} className='Header__logo' />
				</a>
			</header>
		)
	}
}
export default Header
